var title_f4_3_4150="Food allergy oral tolerance";
var content_f4_3_4150=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F64750&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F64750&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 517px\">",
"   <div class=\"ttl\">",
"    Mechanisms of oral tolerance: Antigen dose",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 497px; height: 635px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Oral tolerance is mediated through different mechanisms, depending upon the antigen dose. A, Low doses of ingested antigen induce tolerance via activation of regulatory T cells that produce suppressive cytokines, such as IL-10 and TGF-beta. B. High doses of oral antigen lead to induction of tolerance via anergy (TCR cross-linking occurs without costimulation) or deletion (TCR is cross-linked in the presence of inhibitory molecules, CD95 and CD95L, leading to FAS-mediated apoptosis).",
"    <div class=\"footnotes\">",
"     L: ligand; R: receptor; TCR: T cell receptor",
"    </div>",
"    <div class=\"reference\">",
"     Modified with permission from: Chehade, M, Mayer, L. Oral tolerance and its relation to food hypersensitivities. J Allergy Clin Immunol 2005; 115:3. Illustration used with permission of Elsevier Inc. All rights reserved. Copyright &copy; 2005 Elsevier Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f4_3_4150=[""].join("\n");
