"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Variables",
"       </td>",
"       <td class=\"subtitle1\">",
"        Nasal",
"       </td>",
"       <td class=\"subtitle1\">",
"        Oronasal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Comfort",
"       </td>",
"       <td>",
"        +++",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Claustrophobia",
"       </td>",
"       <td>",
"        +",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rebreathing",
"       </td>",
"       <td>",
"        +",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lowers CO",
"        <sub>",
"         2",
"        </sub>",
"       </td>",
"       <td>",
"        +",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Permits expectoration*",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"       <td>",
"        +",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Permits speech",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        ++",
"       </td>",
"       <td>",
"        +",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Permits eating",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        +",
"       </td>",
"       <td>",
"        -",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Function if nose obstructed",
"       </td>",
"       <td>",
"        -",
"       </td>",
"       <td>",
"        +",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     +: possible; ++: most likely; -: not possible.",
"     <br>",
"      *&nbsp;Expectoration is possible but requires the assistance of a respiratory therapist with oronasal mask.",
"      <br>",
"       &bull; Speech is possible but may vary depending on the degree of respiratory failure.",
"       <br>",
"        &Delta; Eating necessitates oronasal mask removal and may be contraindicated in patients with severe respiratory failure.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
