var title_f4_3_4158="Follicle devel follicular phase";
var content_f4_3_4158=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F61116&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F61116&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Human follicle development",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 447px; height: 323px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic representation of human follicle development during the follicular phase of the menstrual cycle. There are two major events in this process: increased sensitivity of a maturing follicle; and selection of a single dominant follicle. In spontaneous cycles, this is achieved at the beginning of the cycle by a transient increase in serum FSH concentrations above some threshold value; the concentrations then decrease, preventing more than one follicle from undergoing preovulatory development.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Fauser, BC, Van Hevsdeau, AM, et al. Manipulation of human ovarian function: Physiological concepts and clinical consequences. Endocr Rev 1997; 18:71.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
