var title_f4_3_4159="Neonatal HSV neck vesicles";
var content_f4_3_4159=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F75059&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F75059&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Neck vesicles in neonate with herpes simplex virus infection",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 250px; height: 239px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The early, untreated skin lesions associated with neonatal herpes simplex virus (HSV) infection are characteristically clear vesicles on an erythematous base, often touching or \"kissing,\" or coalesced in groups of vesicles. Culture of the clear fluid aspirated or swabbed from the vesicles will readily grow HSV in 24 to 48 hours, and slides made from cells scraped from the base of the lesion will show HSV viral antigens by direct immunofluorescence assay (DFA).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Gail J Demmler-Harrison, MD, Texas Children's Hospital.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
